import * as React from 'react';
import Grid from '@mui/material/Grid';

function UserHost() {
  return (
    <Grid container style={{ height: '100vh' }}>
    <Grid container>
      <Grid item xs={2} style={{ background: 'red', height: '100%' }}>


        <Grid item  style={{ background: 'black', height: '20%'}} >
            <Box
        sx={{
            bgcolor: 'primary.main',
            color: 'primary.contrastText',
            borderRadius: 10,
            p: 2,
        }}
        >
        Hello, world!
        </Box>
        </Grid>
        <Grid item  style={{ background: 'pink', height: '20%'}} ></Grid>
        <Grid item  style={{ background: 'brown', height: '20%'}} ></Grid>

      </Grid>
      <Grid item xs={10} style={{ background: 'blue', height: '100%' }}>
        Column 2
      </Grid>
    </Grid>
    </Grid>

  );
}

export default UserHost;
